import * as React from "react";
import "./style-ping.css";
import * as Mui from "@material-ui/core";

export default function PingDummy({ urlData }) {
	return (
		<>
			<Mui.TableContainer component={Mui.Paper}>
				<Mui.Table style={{ minWidth: "700" }} aria-label="customized table">
					<Mui.TableHead>
						<Mui.TableRow>
							<Mui.TableCell>Top Ping Sites</Mui.TableCell>
							<Mui.TableCell>Counts</Mui.TableCell>
						</Mui.TableRow>
					</Mui.TableHead>
				</Mui.Table>

				{urlData.map((elem) => (
					<Mui.TableRow>
						{" "}
						<Mui.TableRow>
							<Mui.TableCell component="th" scope="row">
								{elem.url}
							</Mui.TableCell>
							<Mui.TableCell component="th" scope="row">
								{elem.count}
							</Mui.TableCell>
						</Mui.TableRow>
					</Mui.TableRow>
				))}
			</Mui.TableContainer>
		</>
	);
}
